  remarks: The members of this enumeration are used by the scanner and the parser to read source code. The members of this enumeration are also used by operator classes to identify the operation to perform. For more information, see [Create a Language Compiler for the .NET Framework](http://go.microsoft.com/fwlink/?LinkId=110392).
